import { useState } from "react";
import React from 'react';
import "./styles.css";

export default function ListingAd({ 
  pic, 
  title,
  address,
  description,
  project_type,
  year,
  ownership_type,
  psf_min,
  psf_max,
  subprice_label,
  availabilities_label,
  clickable_num1,
  descriptionMiddle,
  clickable_num2,
  descriptionMiddle3,
  clickable_num3,
  descriptionEnd
}) {
  const [showDescription, setShowDescription] = useState(false);
  const [clickedNumber, setClickedNumber] = useState(null);
  const [descriptionButton, setDescriptionButton] = useState('See description');

  const handleClick = () => {
    setShowDescription(!showDescription);
    setDescriptionButton(showDescription= 'See description');
  }

  function censorLastDigits(phoneNumber, censored) {
    if (censored) {
      const firstFourDigits = phoneNumber.slice(0, 4);
      const censoredDigits = phoneNumber.slice(4).replace(/\d/g, '*');
      return firstFourDigits + censoredDigits;
    } else {
      return phoneNumber;
    }
  }

  const formatDescription = (description) => {
    const phoneNumberRegex = /\d{8}|\d{4}\s\d{4}/g;
    let currentIndex = 0;
    const formattedDescription = [];
    let match;

    while ((match = phoneNumberRegex.exec(description)) !== null) {
      const phoneNumber = match[0];
      const censoredNumber = censorLastDigits(phoneNumber, phoneNumber !== clickedNumber);

      formattedDescription.push(description.slice(currentIndex, match.index));
      formattedDescription.push(
        <a
          key={match.index}
          className="phone-number-styling"
          onClick={() => setClickedNumber(phoneNumber)}>
          {censoredNumber}
        </a>
      );

      currentIndex = match.index + phoneNumber.length;
    }

    formattedDescription.push(description.slice(currentIndex));

    return formattedDescription;
  };

  return (
    <div className="App">
    <div className="image-container">
      <div className="image-wrapper">
        <div className="carousel">
          <img src="/chevron-left.svg"></img>
          <img src="/chevron-right.svg"></img>
        </div>
      </div>
      <img className="property-image"  src={pic}></img>
    </div>
    <div className="mainContent">
      <div className="mainContent-header">
        <div className="mainContent-details">
          <div className="mainContent-title-container">
            <img src="/building-icon.svg" className="test"></img>
            <div className="header-styling">
              <p className="header-styling-title">{title}</p>
              <p className="property-address">{address}</p>
            </div>
          </div>
          <div className="property-type-container">
              <p className="property-type">{project_type} · {year} · {ownership_type}</p>
              <p className="availabilities-label">{availabilities_label}</p>
            </div>
            </div>
          <div className="property-price">
              <p className="price-psf"> ${psf_min} - ${psf_max} psf</p>
              <p className="price-sublabel">{subprice_label}</p>
          </div>
      </div>
      <div>
      <div className="button-container">
      <button className="button-styling" onClick={handleClick}>
        {descriptionButton}
      </button>
      </div>
      
      {showDescription && (
        <p>
          {formatDescription(description).map((part, index) => (
            <React.Fragment key={index}>
              {part}
            </React.Fragment>
          ))}
        </p>
      )}
    </div>
    </div>
    </div>
  );
}
